	(1,'2015年1元淘拍端午放假通知','2015-06-18','<p><span style=\"text-transform:none;background-color:#ffffff;text-indent:0px;display:inline !important;font:14px/30px 微软雅黑, arial;float:none;letter-spacing:normal;color:#666666;word-spacing:0px;-webkit-text-stroke-width:0px\">大家好！端午节终于来啦！</span><img style=\"border-bottom:0px;border-left:0px;text-transform:none;background-color:#ffffff;text-indent:0px;margin:0px;font:14px/30px 微软雅黑, arial;letter-spacing:normal;color:#999999;border-top:0px;border-right:0px;word-spacing:0px;-webkit-text-stroke-width:0px;padding:0px;\" src=\"http://skin.1yyg.com/Images/Emoticons/37.gif\" /><span style=\"text-transform:none;background-color:#ffffff;text-indent:0px;display:inline !important;font:14px/30px 微软雅黑, arial;float:none;letter-spacing:normal;color:#666666;word-spacing:0px;-webkit-text-stroke-width:0px\">根据国家法定节假日规定，1元淘拍2015年端午节放假安排如下：</span><br style=\"text-transform:none;background-color:#ffffff;text-indent:0px;margin:0px;font:14px/30px 微软雅黑, arial;letter-spacing:normal;color:#666666;word-spacing:0px;-webkit-text-stroke-width:0px;padding:0px;\" /><span style=\"text-transform:none;background-color:#ffffff;text-indent:0px;display:inline !important;font:14px/30px 微软雅黑, arial;float:none;letter-spacing:normal;color:#666666;word-spacing:0px;-webkit-text-stroke-width:0px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;6月20日（周六）至6月22日（周一）放假（共3天），6月23日（星期二）正常上班。</span><br style=\"text-transform:none;background-color:#ffffff;text-indent:0px;margin:0px;font:14px/30px 微软雅黑, arial;letter-spacing:normal;color:#666666;word-spacing:0px;-webkit-text-stroke-width:0px;padding:0px;\" /><br style=\"text-transform:none;background-color:#ffffff;text-indent:0px;margin:0px;font:14px/30px 微软雅黑, arial;letter-spacing:normal;color:#666666;word-spacing:0px;-webkit-text-stroke-width:0px;padding:0px;\" /><span style=\"text-transform:none;background-color:#ffffff;text-indent:0px;display:inline !important;font:14px/30px 微软雅黑, arial;float:none;letter-spacing:normal;color:#666666;word-spacing:0px;-webkit-text-stroke-width:0px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;放假期间揭晓的商品，6月23日正式上班后第一时间安排发出，我们将竭诚为您解答。给您带来的不便，敬请谅解！</span><br style=\"text-transform:none;background-color:#ffffff;text-indent:0px;margin:0px;font:14px/30px 微软雅黑, arial;letter-spacing:normal;color:#666666;word-spacing:0px;-webkit-text-stroke-width:0px;padding:0px;\" /><br style=\"text-transform:none;background-color:#ffffff;text-indent:0px;margin:0px;font:14px/30px 微软雅黑, arial;letter-spacing:normal;color:#666666;word-spacing:0px;-webkit-text-stroke-width:0px;padding:0px;\" /><span style=\"text-transform:none;background-color:#ffffff;text-indent:0px;display:inline !important;font:14px/30px 微软雅黑, arial;float:none;letter-spacing:normal;color:#666666;word-spacing:0px;-webkit-text-stroke-width:0px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;亲爱的拍友，五月五，是端阳，剥个粽子沾上糖，祝您节日愉快！</span><img style=\"border-bottom:0px;border-left:0px;text-transform:none;background-color:#ffffff;text-indent:0px;margin:0px;font:14px/30px 微软雅黑, arial;letter-spacing:normal;color:#999999;border-top:0px;border-right:0px;word-spacing:0px;-webkit-text-stroke-width:0px;padding:0px;\" src=\"http://skin.1yyg.com/Images/Emoticons/12.gif\" /></p>'),
	(2,'1元哄抢即将进入中国大陆','2014-11-04','<p>1元哄抢即将进入中国大陆，敬请期待。一元出品，必为精品！</p><p>我们不卖东西，我们只为他人提供一个便利的平台。</p>');
