	(1016,'中国农业银行传世之宝 〃金元宝〃 Au9999 200g',58999,1,5,'58999','采用传统元宝形制，福禄纹饰及如意花纹，美观精美、工艺精湛，金元宝带来成功新财富！','<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-align: center;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20140814164412240.jpg\" style=\"border: 0px none; color: rgb(153, 153, 153);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 30px 0px 0px; font-size: 28px; line-height: 35px; text-align: center; letter-spacing: 2px;\">中国农业银行传世之宝——金元宝</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 15px 25px 30px; font-size: 14px; line-height: 22px; text-indent: 28px; letter-spacing: 1px;\">中国农业银行传世之宝系列——金元宝 Au9999 200g由中国农业银行总行监制发行。金元宝采用传统元宝形制，正面为&quot;传世之宝&quot;字样、福禄纹饰及如意花纹， 背面为中国农业银行标识、标注成色&quot;Au99.99&quot;、规格，并黏贴有防伪标签。金元宝采用99.99金精工打造，运用复杂的油压技术精炼锻造而成，外形精美、工艺精湛，黄金质感十足。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-align: center;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20140814164423691.jpg\" style=\"border: 0px none; color: rgb(153, 153, 153);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 30px 25px; font-size: 14px; line-height: 22px; text-indent: 28px; letter-spacing: 1px;\">&quot;传世之宝&quot;——金元宝是中国农业银行自主品牌的实物黄金产品，信誉卓著， 为投资者提供更多理财选择。银行销售的实物黄金产品原料都采购自上海黄金交易所，成色有保证； 产品加工企业选取国内最大的金产品加工企业－山东招金集团，加工工艺精美，质量上乘。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-align: center;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20140814164707295.jpg\" style=\"border: 0px none; color: rgb(153, 153, 153);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 30px 25px; font-size: 14px; line-height: 22px; text-indent: 28px; letter-spacing: 1px;\">&quot;传世之宝&quot;——金元宝黄金纯度为99.99%，配备有质量鉴定证书和购回证书。 &quot;传世之宝&quot;是商业银行品牌金条中首个可办理购回的产品，交易时间内随时可变现，交易成本低，手续简便，让您尽享投资收益。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-align: center;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20140814164714552.jpg\" style=\"border: 0px none; color: rgb(153, 153, 153);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 20px; line-height: 35px; text-align: center; letter-spacing: 2px;\">正面</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-align: center;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20140814164721437.jpg\" style=\"border: 0px none; color: rgb(153, 153, 153);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 20px; line-height: 35px; text-align: center; letter-spacing: 2px;\">反面</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 30px 25px; font-size: 14px; line-height: 22px; text-indent: 28px; letter-spacing: 1px;\">&quot;传世之宝&quot;——金元宝寓意为&quot;福禄双至—吉祥如意；传世之宝—招财进宝&quot;。工艺精湛、成色标准、质量上乘， 结合农行国有大行的良好信誉，免去客户挑选鉴定之忧，有较高的收藏价值，同时也是馈赠的佳品。&quot;传世之宝&quot;产品报价优，销售与购回报价紧贴国际黄金市场价格，是投资者的明智之选。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-align: center;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20140814164728117.jpg\" style=\"border: 0px none; color: rgb(153, 153, 153);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 10px; font-size: 16px; line-height: 25px;\">重要说明：</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 10px; font-size: 14px; line-height: 22px;\">1、商品获得者拥有中国农业银行传世之宝&quot;金元宝&quot; Au9999 200g 10年免费使用权。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 10px; font-size: 14px; line-height: 22px;\">2、此款商品由于是银行定制，订货周期需要15-20个工作日，1元云购将在商品到货后的第一时间按订单顺序发出，请谅解。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 10px; font-size: 14px; line-height: 22px;\">3、1元云购对本商品使用权在法律范围内拥有最终解释权。</p><p><span style=\"margin: 0px; padding: 0px; display: inline-block; color: rgb(102, 102, 102); line-height: 20px; word-break: break-all; font-family: arial, 微软雅黑;\"><span style=\"margin: 0px; padding: 0px; color: rgb(232, 0, 0);\"></span></span><br/></p><p><span style=\"margin: 0px; padding: 0px; display: inline-block; color: rgb(102, 102, 102); line-height: 20px; word-break: break-all; font-family: arial, 微软雅黑;\"><span style=\"margin: 0px; padding: 0px; color: rgb(232, 0, 0);\"><br/></span></span></p>',1005,1041,'/productImg/show/1016/1441097504012.jpg',1,'goods_xp',NULL,'2'),
	(1017,'闪迪（SanDisk）至尊高速MicroSDHC-TF 存储卡 32G-Class10-48MB/S',89,1,0,'89','升级更新为48M/S，相机、手机一卡双用！10年质保，重数据安全，选闪迪！','<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 305px 40px 0px 50px; font-size: 15px; line-height: 26px;\">闪迪至尊高速移动<sup>TM&nbsp;</sup>microSDHC<sup>TM</sup>存储卡48MB/S速度是普通移动卡的两到三倍，具备更快应用程序加载、更流畅的全高清摄录和高级拍照功能。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 52px 40px 0px 385px; font-size: 18px; line-height: 26px; font-weight: bold;\">充分发挥您的智能手机或平板电脑的性能</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 20px 40px 0px 385px; font-size: 14px; line-height: 24px; width: 360px;\">闪迪至尊高速移动<sup>TM&nbsp;</sup>microSDHC<sup>TM</sup>存储卡可提高您的智能手机或平板电脑的性能。最高容量可达128GB，为您提供更多空间来容纳数以千计的高精度照片，音乐及全高清视频(1080p)。Class 10 ^的视频等级，可用于录制不间断的全高清视频。高达48MB/秒**的读取速度可缩短应用程序的装载时间，并提升手机的整体性能。搭配原装SD<sup>TM</sup>适配器，轻松完成手机与电脑间的文件传输。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 150px 30px 0px 65px; font-size: 15px; line-height: 24px;\">闪迪至尊高速移动 TMmicroSDHC&nbsp;<sup>TM</sup>存储卡可在恶劣环境下工作，可防水、防震、耐寒耐热、抗X光。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 40px 0px 5px 60px; font-size: 15px; line-height: 22px;\">产品名称：闪迪至尊高速移动<sup style=\"font-size: 12px;\">TM</sup>&nbsp;microSDHC<sup style=\"font-size: 12px;\">TM</sup>存储卡</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 5px 60px; font-size: 15px; line-height: 24px;\">可选容量：8GB、16GB、32GB、64GB、128GB</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 5px 60px; font-size: 15px; line-height: 24px;\">当前选择：32GB</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 25px 0px 0px 60px; width: 380px; font-size: 15px; line-height: 28px;\">如今，智能手机和平板电脑的功能越来越强大，因此需要大量的存储空间。闪迪至尊高速移动<sup>TM</sup>&nbsp;microSDHC<sup>TM</sup>UHS-I存储卡提供了从8GB到128GB多种容量选择，充分满足您照片、视频、音乐等的存储需要。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 80px 0px 0px 460px; font-size: 25px; line-height: 28px;\">选择合适的存储卡</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 20px 0px 0px