	(1018,'苹果（Apple）iPhone 6 A1586 64G版 4G手机',5788,1,0,'5788','4.7 英寸LED 背光宽，Retina HD 高清显示屏，Multi-Touch 显示屏，具有 IPS 技术，1334 x 750 像素分辨率，是 iPhone 的至大之作！','<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 30px 0px 0px; font-size: 60px; line-height: 65px; text-align: center; letter-spacing: 2px;\">iPhone6</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 20px 0px 0px; font-size: 38px; line-height: 38px; text-align: center; letter-spacing: 5px; color: rgb(51, 51, 51);\">比更大还更大</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 20px 20px 0px; font-size: 16px; line-height: 28px; text-align: center;\">iPhone 6 之大，不只是简简单单地放大，而是方方面面都大有提升。<br/>它尺寸更大，却纤薄得不可思议；性能更强，却效能非凡。光滑圆润的金属机身，<br/>与全新 Retina HD 高清显示屏精准契合，浑然一体。而软硬件间的搭配，更是默契得宛如天作之合。<br/>无论以何种尺度衡量，这一切，都让 iPhone 新一代的至大之作，成为至为出众之作。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 10px 0px; text-align: center;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20140910143950500.jpg\" style=\"border: 0px none; color: rgb(153, 153, 153);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 220px 0px 0px 60px; font-size: 34px; line-height: 48px; letter-spacing: 2px; color: rgb(51, 51, 51);\">是 iPhone 的至大之作，<br/>也是至薄之作。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 20px 10px 0px 60px; font-size: 15px; line-height: 28px;\">要开发一个尺寸更大，更先进的 iPhone 显示屏，就要在设计上大大突破极限。从金属与玻璃的精密结合，到光滑圆润的流线机身，每处细节都是深思熟虑的结晶，旨在带给你更为出众的使用体验。因此，虽然 iPhone 6 的显示屏变大了，但却让人感觉大得恰到好处。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 240px 0px 0px 80px; font-size: 25px; line-height: 48px; letter-spacing: 2px; color: rgb(51, 51, 51);\"><span style=\"font-size: 65px; line-height: 70px;\">6.9</span>&nbsp;毫米</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 90px; font-size: 15px; line-height: 22px; letter-spacing: 2px; color: rgb(51, 51, 51);\">iPHONE 6</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 25px 0px 0px 80px; font-size: 25px; line-height: 48px; letter-spacing: 1px; color: rgb(51, 51, 51);\"><span style=\"font-size: 65px; line-height: 70px;\">7.1</span>&nbsp;毫米</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 90px; font-size: 15px; line-height: 22px; letter-spacing: 1px; color: rgb(51, 51, 51);\">iPHONE 6 PLUS</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 20px 0px 0px; text-align: center;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20140910144019403.jpg\" style=\"border: 0px none; color: rgb(153, 153, 153);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 120px 0px 0px 20px; font-size: 42px; line-height: 55px; letter-spacing: 2px; color: rgb(51, 51, 51);\">不仅更大<br/>更大放异彩</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 20px 10px 0px 20px; font-size: 15px; line-height: 28px; width: 390px;\">把显示屏做大并非难事，但打造一块将绚丽色彩、更高对比度、更广阔浏览视角集于一身的大尺寸 Multi-Touch 显示屏，则完全是另一个境界的事。 而这，也正是我们在全新 Retina HD 高清显示屏上所做到的。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 20px 0px 0px 20px; font-size: 42px; line-height: 55px; letter-spacing: 2px; color: rgb(51, 51, 51);\">1334×750</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 10px 0px 20px; font-size: 16px; line-height: 28px; width: 390px;\">iPHONE 6分辨率</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 10px 0px 0px 20px; font-size: 42px; line-height: 55px; letter-spacing: 2px; color: rgb(51, 51, 51);\">1920×1080</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 10px 0px 20px; font-size: 16px; line-height: 28px; width: 390px;\">iPHONE 6 PLUS 分辨率</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 265px 0px 0px 20px; font-size: 42px; line-height: 55px; letter-spacing: 2px; color: rgb(51, 51, 51);\">大有动力,大有能效。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 20px 10px 0px 20px; font-size: 15px; line-height: 28px; width: 390px;\">新一代 A8 芯片基于 64 位台式电脑级架构，可提供更为强劲的动力，即使是驱动这样一个更大的显示屏也游刃有余。M8 运动协处理器则能通过先进的传感器和全新的气压计来高效地收集数据。再加上提升的电池使用时间，iPhone 6 能让你拥有更多时间，去做到更多。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 320px 0px 0px; font-size: 38px; line-height: 55px; letter-spacing: 2px; color: rgb(51, 51, 51); text-align: center;\">一个相机，改变了摄影，<br/>又将颠覆摄像。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 20px 10px 0px 20px; font-size: 15px; line-height: 28px; text-align: center;\">越来越多的人喜欢用 iPhone 来随时随地拍摄照片。而现在，配备全新传感器的 iSight 摄像头不仅支持 Focus Pixels，还新增更多视频功能。比如你可以拍摄 60 fps 的 1080p HD 高清视频，240 fps 的慢动作视频，还可以选择延时摄影模式。因此，你将有更多理由用视频去捕捉更多的美好时刻，就像拍照一样简单自然。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 20px 10px 0px 160px; line-height: 22px;\">全新的传感器支持 Focus Pixels，<br/>可实现更快的自动对焦。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 100px 0px 0px 430px; font-size: 42px; line-height: 55px; letter-spacing: 2px; color: rgb(51, 51, 51);\">更快无线连接，<br/>连接更宽广。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 20px 10px 0px 430px; font-size: 15px; line-height: 28px; width: 350px;\">有了更快的 4G LTE 网络下载速度*，以及更多 LTE 频段支持，iPhone 6 能让你在更广阔的天地，更自由地遨游。而当你接入无线网络时，还能体验到快达 3 倍的无线网络速度。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 140px 0px 0px 20px; font-size: 42px; line-height: 55px; letter-spacing: 2px; color: rgb(51, 51, 51);\">安全，全凭指尖。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 20px 10px 0px 20px; font-size: 15px; line-height: 28px; width: 360px;\">突破性的 Touch ID 技术让你安全访问自己的 iPhone 有了独一无二的密码：你的指纹。并且，这一方式还能用来确认你在 iBooks 和 App Store 中的下载或购买，从而无需再输入密码。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 140px 0px 0px 430px; font-size: 42px; line-height: 55px; letter-spacing: 2px; color: rgb(51, 51, 51);\">有史以来极其重大的 iOS 版本</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 20px 10px 0px 430px; font-size: 15px; line-height: 28px; width: 350px;\">iOS 8 是了不起的先进移动操作系统，它以令人惊叹的全新功能和特性，将大显示屏的优势尽致呈现。对 iPhone 6 来说，这不仅仅是一次软硬件间宛如天成的绝佳匹配，更是创造了一种将每个细微之处，都变得大为出众的绝佳体验。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 20px 0px 5px 5px; font-size: 18px; line-height: 25px;\">重要说明：</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 5px 5px; font-size: 14px; line-height: 22px;\">1、1元云购将在商品到货后第一时间按订单顺序发出，颜色随机发货。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 5px 5px; font-size: 14px; line-height: 22px;\">2、商品获得者拥有苹果（Apple）iPhone 6 A1586 64G版 4G手机 10年免费使用权。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 5px 5px; font-size: 14px; line-height: 22px;\">3、1元云购对本商品使用权在法律范围内拥有最终解释权。</p><p><br/></p>',1001,1029,'/productImg/show/1018/1441100359777.jpg',1,'goods_rq',NULL,'2'),
	(1019,'2015款 宝马（BMW）3系 320Li 豪华型 四门轿',459999,1,0,'459999','（商品价格已包含购置税、上牌费、保险费费用）以丰富设计套装，彰显独特品味！','<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 10px 0px 0px; font-size: 32px; line-height: 40px; text-align: center; letter-spacing: 3px;\">2015款 宝马3系 320Li 豪华型 四门轿车</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 15px 0px 0px; font-size: 18px; line-height: 28px; text-align: center; letter-spacing: 3px;\">以丰富设计套装，彰显独特品味！</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 10px 0px 20px; font-size: 14px; line-height: 24px; text-indent: 28px;\"><span style=\"font-weight: bold;\">新BMW&nbsp;</span>3系四门轿车传承了BMW品牌的设计传统和特点。运动而优雅的外观创造出BMW品牌特有的统一效果，第一眼便能感受到其中蕴含的美感和动感。第6代车型再一次树立了新标准，成为全球最畅销的BMW车辆。 受车型悠久历史的启发，时尚而强健的设计凸显了BMW品牌的核心灵魂--始终通过BMW特有的比例令人心悦诚服。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-align: center;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20150821182136489.jpg\" style=\"border: 0px none; color: rgb(153, 153, 153);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 10px 0px 20px; font-size: 14px; line-height: 24px; text-indent: 28px;\">新BMW 3系首次充分利用了双肾型进气格栅的侧面效果。配有11根镀铬板条的BMW双肾型进气格栅给人以繁复但又醒目的印象。 此外，前裙板进气口中两个稍稍偏移的镀铬板条也与该设计套装的整体形象完美匹配。配备豪华设计套装的BMW 3系四门轿车极为经典而优雅的设计令人印象深刻。 审慎而优雅的高光镀铬设计元素将外部的独特性与运动灵活性结合在一起，成为该设计套装个性化配置的特征。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-align: center;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20150821182143801.jpg\" style=\"border: 0px none; color: rgb(153, 153, 153);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 10px 0px 20px; font-size: 14px; line-height: 24px; text-indent: 28px;\">多辐17英寸轻质铝合金轮圈与经过镀铬处理侧窗镶边，使配备豪华设计套装的BMW 3系四门轿车的侧视更显优雅。 沿着后保险杠分布的一条优雅的高光镀铬饰条进一步强调了豪华设计套装的经典设计。排气管饰件采用高光镀铬设计。新BMW 3系车型的出色动力表现主要得益于经典的BMW后轮驱动系统。每个车轮上的减震阀均通过传感器进行控制，以确保始终提供不折不扣的舒适性。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-align: center;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20150821182149480.jpg\" style=\"border: 0px none; color: rgb(153, 153, 153);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 10px 0px 20px; font-size: 14px; line-height: 24px; text-indent: 28px;\">带有哑光镀铬高光装饰性饰条的炫晶灰色优质装饰性木制表面，或带有精美镶嵌件的优雅的根木表面树立了独特性方面的新标准。 三种带有独特缝线的优质真皮套和一种织物套 (提供有四种经典的优雅颜色，带有独特缝线) 强调了豪华设计套装营造出的诱人氛围。这是唯一一个为收音机和自动空调控制单元提供镀铬条镶边的设计套装。 作为豪华设计套装一项与众不同的特点，车钥匙采用了带有镀铬装饰条的黑色设计。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-align: center;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20150821182155190.jpg\" style=\"border: 0px none; color: rgb(153, 153, 153);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 10px 0px 20px; font-size: 14px; line-height: 24px; text-indent: 28px;\">8速手自一体变速箱。最动态最舒适的节省方式： 8速手自一体变速箱不仅能够确保令人惊叹的轻柔换档操作，降低高速行驶时的背景噪音，而且还能显著降低耗油量。该变速箱可与包括入门级发动机在内的所有发动机搭配使用。8速手自一体变速箱换档过程迅速而舒适，如果不是有转速表的显示，驾驶者几乎难以察觉。 各个档位经过了精细的调校，因此缩短了发动机的换档行程，从而使您几乎察觉不到换档过程。 同时，发动机的性能水平始终保持在动力和效率完美配合的最佳状态。 全新开发的效率更高的变矩器离合器为系统提供辅助。 转速较高时，发动机转速因附加档位而下降，因此降低了油耗和发动机噪音。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-align: center;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20150821182202500.jpg\" style=\"border: 0px none; color: rgb(153, 153, 153);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 10px 0px 20px; font-size: 14px; line-height: 24px; text-indent: 28px;\">BMW 3系四门轿车上市时提供了四款采用最新BMW双涡管单涡轮增压技术的高扭矩、低油耗发动机。它们是BMW 3系四门轿车强劲动力的来源。 采用BMW双涡管单涡轮增压技术的全新高动力2.0升发动机是新一代四缸火花点火发动机中最强劲的一款发动机，它们沿用了备受赞誉的六缸汽油发动机的技术。 作为BMW高效动力策略 (BMW EfficientDynamics) 发展战略的组成部分，这些发动机经过了系统化的设计，目标是在增强动态驾驶性能的同时降低耗油量和排放值。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-align: center;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20150821182208232.jpg\" style=\"border: 0px none; color: rgb(153, 153, 153);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 20px 0px 0px; font-size: 18px; line-height: 25px;\">重要说明：</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 10px 0px 0px; font-size: 14px; line-height: 25px;\">1、商品获得者拥有2015款 宝马（BMW）3系 320Li 豪华型 四门轿车 20年免费使用权。<br/>2、商品价格已包含购置税、上牌费、保险费费用，其中，不含居住证费用。因深圳地区限购，目前揭晓的商品将会上深圳、东莞或惠州的车牌。<br/>3、1元云购对本商品使用权在法律范围内拥有最终解释权。</p><p><br/></p>',1007,NULL,'/productImg/show/1019/1441100945972.jpg',1,'goods_xp','','0');
